const ADD_MESEGE = 'ADD-MESEGE';


type MesegeDateType = {
  id: number,
  name: string
}

type diaDateType = {
  id: number, 
  name: string, 
  src: string
}
let initialState = {
  mesegeDate: [
    {id: 1, name: 'How are you?'}, 
    {id: 2, name: 'Im fine'}, 
    {id: 3, name: 'No bed'}
  ] as Array<MesegeDateType>,
  diaDate: [
    {id: 1, name: 'Dimma', src: 'data:image/jpeg;base64,'}, 
    {id: 2, name: 'Irina', src: "data:image/jpeg;base64,"}, 
    {id: 3, name: 'Vasial', src: "data:image/jpeg;base64,"}
  ] as Array<diaDateType>,
}

export type InitialStateType = typeof initialState

const dialogsReducer = (state = initialState, action: any): InitialStateType => {

  switch (action.type) {
    
    case ADD_MESEGE: 
      return {...state,
        mesegeDate : [...state.mesegeDate, {id: 4, name: action.newMessegeBoddy}],
      };

    default:
      return state;
  }
}


type AdMessegeActionCreaterType = {
  type: typeof ADD_MESEGE,
  newMessegeBoddy: any
}
export const adMessegeActionCreater = 
(newMessegeBoddy: string): AdMessegeActionCreaterType => ({type: ADD_MESEGE, newMessegeBoddy});


export default dialogsReducer;